INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "春咲 ひより", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1001, 0, 1, 1, "お！\nあそこに困ってそうな人発見！", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "草野 優衣", "みんなみたいに\nわたしも強くならなきゃ", 1002, 0, 1, 1, "大切な人を\n守れるようになりたい…って", "わ、わたし、\nなに言ってるんだろ\nあはは…", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "士条 怜", "フェンシングを始めてみては？", 1003, 0, 1, 1, "キミに必要な集中力と感性が", "少しは磨かれると思いますよ。", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "穂高 みそぎ", "ねぇ、にいちゃん！", 1004, 0, 1, 1, "今日はなにして遊ぶ？", "みそぎはねぇ、\nかくれんぼやりたい！", 1.5, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "風宮 あかり", "風宮あかりです", 1006, 0, 1, 1, "ねぇ…", "私といっしょに…\nいかない？", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "出雲 宮子", "出雲宮子なのー", 1007, 0, 1, 1, "プリンたべたいのー", "食べ物の恨みは怖いのー", 1.5, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "虹村 雪", "ボクは虹村雪。", 1008, 0, 1, 1, "キミもボクの美貌に\n吸い寄せられたんだね。", "いいよ。\n見られることは運命さ…", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "柊杏奈", "フッ…聞いて後悔するがいい！", 1009, 0, 1, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "人呼んで「疾風の冥姫」!!", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "姫宮 真歩", "マホマホ王国のプリンセス、\nまほ姫どす", 1010, 0, 1, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "ほんまおおきにやわ～♪", 1.5, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "衣之咲 璃乃", "衣之咲璃乃です！", 1011, 0, 1, 1, "生き別れたお兄ちゃんを探して\n三千世界！", "ここで会ったが\n100年目～！", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "柏崎 初音", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1012, 0, 1, 1, "ち、超能力って…\n何のことかな～？", "…って、お願い！\n誰にも言わないでおいて～！", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "美波 鈴奈", "ちょす！\n美波鈴奈だよ～♪", 1016, 0, 1, 1, "一応カリスマ読モJKやってまっす！", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "喜屋武 香織", "はいたーい。\n喜屋武香織さー。", 1017, 0, 1, 1, "東京は遊園地みたいなところさー", "でも、沖縄もとってもいいとこさー", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "支倉 伊緒", "支倉伊緒です。", 1018, 0, 1, 1, "先生って呼ばれるのは\nくすぐったいから", "イオちゃんって呼んでね。", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "茜 ミミ", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1020, 0, 1, 1, "あ！/\お兄ちゃ～ん\nまってよ～", "ミミをおいてかないでぇ～", 1.5, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "栗林 くるみ", "あ…あの…えっと…\n栗…林…くるみ…です……", 1021, 0, 1, 1, "あの……\nふぇ……", "ふぇぇぇぇぇん……", 1.5, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "風宮 より", "風宮よりです。\nあああああ！", 1022, 0, 1, 1, "こんな私に貴重な時間を\n割いていただき、", "なんてありがとうございます！", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "北条 綾音", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1023, 0, 1, 1, "おにいちゃんどこいくの？\nえ？", "私こっち行きたいー\nね、早く早くー", 1.5, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "天野 すずめ", "わっ…わっ…私、\n天野すずめといいます！", 1025, 0, 1, 1, "ふ、不束者ですが\nどうぞ末永く…って、", "これて何か違う…\nあああすみません！", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "倉石 恵理子", "……クスクス…私は\n…倉石恵理子……", 1027, 0, 1, 1, "あなたは…運命の……\n伴侶……", "離しませんわ………\n絶対に…!!", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "佐々木 咲恋", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1028, 0, 1, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "…そうでしょ？？", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "桜井 望", "桜井望だよ！\nよろしくねっ", 1029, 0, 1, 1, "ぇっと…\nキミ、私のこと知らないの?!", "あはは、\n私もまだまだだなぁ～", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "ニノン・ジュベール", "デケデケデンっ！", 1030, 0, 1, 1, "初めまして、\n私はニノン・ジュベール申すデス！", "ショーグン、\nワタシと一緒に天下統一デース！", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "上喜 しのぶ", "上喜しのぶです。\n手元のドクロが父です。", 1031, 0, 1, 1, "でもって私の隣にいるのが……\nえ、見えない？", "おかしいですね……", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "野戸まひる", "目指すはビッグな\nお笑い芸人だっぺ！", 1033, 0, 1, 1, "けんども\nそれには足りないモンが…", "そう、\nオラのボケに突っ込める相方が…！", 1.5, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "綾瀬 ゆかり", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1034, 0, 1, 1, "ちょっと緊張しちゃって…", "ちょ\nちょっと一杯飲んできます…！", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "氷川 鏡華", "氷川鏡華…です", 1036, 0, 1, 1, "知らない人とは話しちゃいけないので", "これ以上お話しすることは…\nないです！", 1.5, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "柏崎 栞", "柏崎…栞です。", 1038, 0, 1, 1, "……あ、アラーム。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "双葉 碧", "ふ、双葉碧です。", 1040, 0, 1, 1, "私、一人も友達がいなくて……", "野に咲く花が、\n唯一の話相手です。", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "三角 千歌", "三角千歌です。", 1042, 0, 1, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "そう思っています。", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "安芸 真琴", "安芸真琴だ。", 1043, 0, 1, 1, "あぁ？\nお前のそいつの仲間か？", "う、疑ってすまなかったな…", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "イリヤ・オーンスタイン", "わらわこそは夜を総べる者！", 1044, 0, 1, 1, "生けとし生ける全ての者よ！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "遠見 空花", "そこで騎士は妖精を乱暴に……", 1045, 0, 1, 1, "ぐふふふふ……はっ！", "ｌク、クウカに何かご用ですか!?", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "宮坂たまき", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1046, 0, 1, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "う～ん…\n猫ってホントに最高にゃ～♪", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "大神 美冬", "大神美冬よ！", 1048, 0, 1, 1, "それでは早速クエストに…", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "星野静流", "星野静流だよ！", 1049, 0, 1, 1, "クエストもバトルも\n掃除も洗濯も", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "玉泉美咲", "アタシは玉泉美咲。", 1050, 0, 1, 1, "見ての通りの\nセクシー美少女で", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1.5, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "リマ", "？？？", 1052, 0, 1, 1, "？？？？", "？？？？", 1.4, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "モニカ・ヴァイスヴィント", "モニカ・ヴァイスヴィントだ。", 1053, 0, 1, 1, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1.5, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "ペコリーヌ", "モニカ・ヴァイスヴィントだ。", 1058, 0, 1, 1, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1.5, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "コッコロ", "モニカ・ヴァイスヴィントだ。", 1059, 0, 1, 1, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1.5, 1, 0, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (0, 2, 0, "キャル", "モニカ・ヴァイスヴィントだ。", 1060, 0, 1, 1, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1.5, 1, 0, 0);
